import NavBar from './NavBar';
import Home from "./Home";
import AboutUs from "./AboutUs";
import TheDen from "./TheDen";
import News from "./News";
import Projects from "./Projects";
import ContactUs from "./ContactUs";

function App() {
  // console.log(window.location) used to look for the pathname
  let component
  switch (window.location.pathname) {
    case "/":
      component = <Home/>
      break
    case "/AboutUs":
      component = <AboutUs/>
      break
    case "/TheDen":
      component = <TheDen/>
      break
    case "/News":
      component = <News/>
      break
    case "/Projects":
      component = <Projects/>
      break
    case "/ContactUs":
      component = <ContactUs/>
      break
    default:
      component = <Home />
      break

  }
  return (
    <>
      <NavBar/>
      {component}
    </>
  )
}
export default App;
